  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2005-2014.  In 2013 and subsequently,
  one question in the core of BRFSS asks about vision: Are you blind or do you have
  serious difficulty seeing, even when wearing glasses?  From 2005-2011 the BRFSS
  employed a ten question vision module regarding vision impairment, access and utilization
  of eye care, and self-reported eye diseases.  The Vision and Eye Health Surveillance
  System is intended   to provide population estimates of vision loss function, eye
  diseases, health disparities, as well as barriers and facilitators to access to
  vision and eye care.  This information can be used for designing, implementing,
  and evaluating vision and eye health prevention programs.</p>n\",\n\t\"license_title\":
